  const ne =
    status === 'pending' ? <div className="pending">.</div> : <div>.</div>
  return (
    <tr>
      <td>{title}</td>
      <td>{dueOn}</td>
      <td>{ne}</td>
      <td>{UserId}</td>
    </tr>
  )
}
export default Body
